import React from 'react';

const StudentDashboard: React.FC = () => {
  return (
    <div style={{ padding: 20 }}>
      <h2>Tableau de bord Étudiant</h2>
      <p>Contenu et fonctionnalités pour l’étudiant ici.</p>
    </div>
  );
};

export default StudentDashboard;
